export default function SummaryCart({ product }) {
    const { } = useCart()
    return (
        <div className="summary-cart">
            <div className="title">Resumen del carrito</div>
            <div className="data">
                <Table celled structured>
                    <Table.Header>
                        <Table.Row>
                            <Table.HeaderCell>Producto</Table.HeaderCell>
                        </Table.Row>
                    </Table.Header>
                </Table>
            </div>
        </div>
    )
}
